import React from 'react';
import { 
  Box, 
  IconButton, 
  Stack, 
  Typography, 
  Breadcrumbs, 
  Link, 
  Container,
  Paper
} from '@mui/material';
import { ArrowLeft, Shield } from 'lucide-react';

const TierHeader = ({ bundle, subBundle, onBackClick, isDarkMode }) => {
  return (
    <Paper 
      elevation={0} 
      sx={{ 
        bgcolor: 'grey.50', 
        borderBottom: '1px solid',
        borderColor: 'grey.200',
        py: 3
      }}
    >
      <Container maxWidth="lg">
        <Stack direction="row" alignItems="center" spacing={3}>
          <IconButton
            onClick={onBackClick}
            sx={{ 
              bgcolor: 'white',
              border: '1px solid',
              borderColor: 'grey.300',
              '&:hover': {
                bgcolor: 'grey.100'
              }
            }}
          >
            <ArrowLeft size={20} />
          </IconButton>

          <Box sx={{ flex: 1 }}>
            <Breadcrumbs separator="â€º" sx={{ mb: 1 }}>
              <Link 
                color="text.secondary" 
                underline="hover" 
                sx={{ cursor: 'pointer' }}
                onClick={onBackClick}
              >
                {bundle?.name?.replace(' SUITE', '') || 'Security Suite'}
              </Link>
              <Typography color="text.primary" fontWeight="medium">
                {subBundle?.name?.replace(' Package', '') || 'Security Package'}
              </Typography>
            </Breadcrumbs>

            <Stack direction="row" alignItems="center" spacing={2}>
              <Shield size={20} color="#1976d2" />
              <Typography variant="h4" fontWeight="bold" color="text.primary">
                Security Plans & Pricing
              </Typography>
            </Stack>

            <Typography variant="body1" color="text.secondary" sx={{ mt: 1 }}>
              Professional security solutions designed for your business needs
            </Typography>
          </Box>
        </Stack>
      </Container>
    </Paper>
  );
};

export default TierHeader;
